import React, { useState } from "react";
import "./Navbarcss.css";
import { FaBars, FaTimes } from "react-icons/fa";
import { NavLink } from "react-router-dom/dist/umd/react-router-dom.development";
import { useLocation } from "react-router-dom";

const Navbar = () => {
  const [onclick, setclick] = useState(false);
  const handleclick = () => setclick(!onclick);
  const location = useLocation();
  const { pathname } = location;
  const splitLocation = pathname.split("/");
  console.log(splitLocation[1]);
  return (
    <div className="header">
      <NavLink href="/">
        {" "}
        <img
          src={require("../images/DOCTORSPECTRA-1.jpeg")}
          width="150px"
          height="60px"
          alt="logo"
        />
      </NavLink>
      <ul className={onclick ? "nav-menu active" : "nav-menu"}>
        <li>
          <NavLink activeClassName="acctive" to="/">
            Home
          </NavLink>
        </li>
        <li
          className={splitLocation[1] === "Solutions we offer" ? "Active" : ""}
        >
          <NavLink to="/Solutions we offer">Solutions we offer</NavLink>
        </li>
        <li
          className={
            splitLocation[1] === "how technology works" ? "Active" : ""
          }
        >
          <NavLink to="/how technology works">How the technology works</NavLink>
        </li>
        <li className={splitLocation[1] === "about" ? "Active" : ""}>
          <NavLink to="/about">About</NavLink>
        </li>
        <li className={splitLocation[1] === "contact" ? "Active" : ""}>
          <NavLink to="/contact">Contact Us</NavLink>
        </li>
        <li className={splitLocation[1] === "blogs" ? "Active" : ""}>
          <NavLink to="/blogs">Blogs</NavLink>
        </li>
      </ul>
      <div className="icon" onClick={handleclick}>
        {onclick ? (
          <FaTimes size={30} style={{ color: "white" }} />
        ) : (
          <FaBars size={30} style={{ color: "white" }} />
        )}
      </div>
    </div>
  );
};

export default Navbar;
